const object = [
	{
		img: {
			src: instagram,
			text: "@guadalupe_estudio",
			className: "w-10",
		},
		a: {
			href: "",
			className: "link ml-3 mr-5 font-italic",
		},
	},
	{
		img: {
			src: facebook,
			text: "@guadalupe.estudio",
			className: "w-10",
		},
		a: {
			href: "",
			className: "link ml-3 mr-5 font-italic",
		},
	},
	{
		img: {
			src: mail,
			text: "hola@guadalupeestudio.cl",
			className: "w-10",
		},
		a: {
			href: "",
			className: "link ml-3 mr-5 font-italic",
		},
	},
];

export default object;
